import React from 'react';
import { StyleSheet, View, Button, Text, Image, Dimensions, TouchableOpacity } from 'react-native';
import { Ionicons } from '@expo/vector-icons';

//====================================================================




//====================================================================
const StorageUnitLowStock = () => {

    return (
        <View style={styles.container}>
            <View style={styles.line1Style}>
                <Text style={styles.text1Styles}>Seafood Freezer</Text>
                <View style={styles.rectangle1Style}>
                    <View style={{ flex: 1, justifyContent: "center", alignItems: "flex-end", marginRight: 10 }}>
                        <Ionicons name="ios-settings-outline" size={24} color="black" />
                    </View>

                    <View style={{ flex: 5, justifyContent: "center", alignItems: "center" }}>

                        <Text>
                            <TouchableOpacity
                                onPress={() => { }}
                            >
                                <Text style={{ color: "white" }}>Edit </Text>
                            </TouchableOpacity>

                        </Text>
                    </View>
                </View>

            </View>

           
        </View>
    )
}
const deviceWidth = Math.round(Dimensions.get('window').width);
const styles = StyleSheet.create({
    container: {
        backgroundColor: '#FFFFFF',
        alignItems: 'center',
        //gap: 8,
    },
    line1Style:{
        flexDirection: 'row',
        justifyContent: 'space-between',
        width: '90%',
    },
    text1Styles:{
        fontFamily: 'GeneralSans-Bold',
        fontSize: 25,
        color: '#000000',
        fontWeight: 'bold',
    },
    rectangle1Style:{
        flexDirection: "row",
        backgroundColor: '#000000',
        width: '25%',
        height: 27,
        borderRadius:10,
        shadowColor: '#00000029',
        shadowRadius: 30,
        opacity:'30%'
    }
});

export default StorageUnitLowStock;
